import React, { Component } from 'react'
import {Link} from '@reach/router'

export class NavBar extends Component {
    render() {

        return (
            <div>
                <nav>
                    <Link to="">Home</Link>|
                    <Link to="">Technologies</Link>
                    <Link to="">Projects</Link>
                    <Link to="">GitHub</Link>
                    <Link to="">LinkedIn</Link>
                </nav>
            </div>
        )
    }
}

export default NavBar
